import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Roll } from "react-reveal";
import Carousel from "react-spring-3d-carousel";
import { uuidv4 } from "node-uuid";

const slides = [
  {
    key: uuidv4(),
    content: <img src="https://picsum.photos/800/800/?random" alt="1" />
  },
  {
    key: uuidv4(),
    content: <img src="https://picsum.photos/800/800/?random" alt="2" />
  },
  {
    key: uuidv4(),
    content: <img src="https://picsum.photos/600/800/?random" alt="3" />
  }
];

export class Interests extends Component {
  render() {
    return (
      <div>
        <Container id="interest" className="interests-section">
          <Row>
            <Col>
              <h2>
                <Roll left cascade>
                  INTERESTS
                </Roll>
              </h2>
              <Roll left>
                <hr />
              </Roll>
            </Col>
          </Row>
          <Carousel slides={slides} />
        </Container>
      </div>
    );
  }
}

export default Interests;
